<p>it doesn't actually look like a Mongoose Document at all. I would post the result of <code>{...createdNPC}</code> to show the difference but it's a huge code snippet and I don't want to clutter the question. I'm happy to provide it if it will help!</p>

<p>I'm still very new to MongoDB &amp; Mongoose. Why would using the spread syntax on a Mongoose Document change its value?</p>

