Adding to a double-nested array in MongoDB<p>I have a double nested array in my MongoDB schema and I'm trying to add an entirely new array element to a second-level nested array using $push. I'm getting the error <code>cannot use the part (...) to traverse the element</code></p>

<p>A documents have the following structure</p>

<pre><code>{
    "_id" : ObjectId("5d8e37eb46c064790a28a467"),
    "org-name" : "Manchester University NHS Foundation Trust",
    "domain" : "mft.nhs.uk",
    "subdomains" : [ {
            "name" : "careers.mft.nhs.uk",
            "firstSeen" : "2017-10-06 11:32:00",
            "history" : [
                {
                    "a_rr" : "80.244.185.184",
                    "timestamp" : ISODate("2019-09-27T17:24:57.148Z"),
