                                  ],
                                    "timestamp" : ISODate("2019-09-27T17:24:58.538Z")
                                }
                            }
                        ]

                    }
                ]
}

</code></pre>

<p>What I'm attempting to do is refresh the details held in the <code>history</code> array and add another entire array entry to represent the most recently collected data for the <code>subdomain.name</code></p>

