How to fix login and logout in jinja template based on user session?<p>My login system is working well in terms of connecting with the DB. However, somehow my jinja template is showing <code>account/logout</code> as soon as a user loads the website instead of <code>login/register</code>. But when users go to <code>account</code> it goes to <code>login</code>. In other words, it's showing the other way around.</p>

<p>I have done the conditional as follow:</p>

<pre><code>{% if session['email'] == None %}
          &lt;li class="nav-item"&gt;
            &lt;a class="nav-link" href="{{url_for('login')}}"&gt;Login&lt;/a&gt;
          &lt;/li&gt;
          &lt;li class="nav-item"&gt;
            &lt;a class="nav-link" href="{{url_for('register')}}"&gt;Register&lt;/a&gt;
          &lt;/li&gt;
          &lt;!--WILL DISPLAY HOME/LOGIN/REGISTER WHEN LOGGED IN--&gt;
          {% else %}
          &lt;li class="nav-item"&gt;
            &lt;a class="nav-link text-success" href="{{url_for('user')}}"&gt;Account&lt;/a&gt;
          &lt;/li&gt;
          &lt;li class="nav-item"&gt;
            &lt;a class="nav-link" href="{{url_for('logout')}}"&gt;Logout&lt;/a&gt;
          &lt;/li&gt;
          {% endif %}
</code></pre>

<p>In addition, I am almost sure that the template is not the problem, rather the login function that I am trying to fix but with no success:</p>

<pre><code>@app.route('/login', methods=['POST', 'GET'])
def login():
    if request.method == 'GET': 
        return render_template('login.html')
    else:
        user = mongo.db.user
        login_user = user.find_one({
        'email': request.form.get('email'), 
        'password':request.form.get('password'
        )})

        if login_user:
            session['email'] = login_user['email']
            session['name'] = login_user['name']
            return redirect(url_for('user'))

        return 'Invalid username or password combination'
</code></pre>

