How to properly catch exception from MongoDB?<h3>Problem</h3>

<p>My <code>try</code> doesn't <code>catch</code> error if it is inside of MongoClients <code>connect</code> function</p>

<hr>

<h3>Environment</h3>

<ul>
<li>Linux (Mint, Tessa)</li>
<li>Node.js v10.16.0 (using ES6 with <strong>nodemon</strong>)</li>
<li>MongoClient (from mongodb npm repository)</li>
</ul>

<hr>

<h2>Example</h2>

<p>If I try this:</p>

<pre><code>try {
    throw new Error('This is error');
} catch(e) {
    console.log(`Catched: ${e}`);
}
</code></pre>

<p>I get <strong>clean exit</strong> (it's fine - working)</p>

<pre><code>Catched: Error: This is error
[nodemon] clean exit - waiting for changes before restart
</code></pre>

<h3>But this doesn't work</h3>

<p>If I try it in MongoDBs connect function:</p>

<pre><code>try {
   MongoClient.connect(config.url, config.options, (err, db) =&gt; {
      if (err) { throw new Error('This is error'); }
   });
} catch (err) {
   console.log(`Catched: ${e}`);
}
</code></pre>

<p>I get <strong>app crashed</strong></p>

<pre><code>Error: This is error
[nodemon] app crashed - waiting for file changes before starting...
</code></pre>

<p>So it means it didn't catch my exception.</p>

